function processContentRecords(content) {
	var recs = new Array();
	var txt = content; //content.replace("\\\"", "\"");
	var temp_recs = txt.split("{\"id\":");
	
	var s = "";
	
	for (var i=0; i<temp_recs.length; i++) {
		console.debug("temp#" + i + " - " + temp_recs[i]);
		if (temp_recs[i].indexOf("{\"X-Experience") != -1) { continue; }
		
		if (temp_recs[i].indexOf("\"http") != -1) { 
			s += "{\"id\":" + temp_recs[i]; 
		} else {
			if (s != "") { 
				s = s.replace(/},$/, "}");
				recs.push(s); 
			}
			s = "{\"id\":" + temp_recs[i]; 
		}
	}	
	s = s.replace(/},$/, "}");
		
	for (var i=0; i<recs.length; i++) {
		console.debug("#" + i + " - " + recs[i]);
	}	
	return recs;
}
	


function prettyPrintJSON(element, level) {
	var indent = (arguments.length === 1) ? 0 : level;
	
	var propertyName;
	var propertyValue;
	
	var s = "";
	for (var i = 0; i < indent; i++) { s += "\t"; }
	
	for(propertyName in element) {
		propertyValue = element[propertyName];
		if ( typeof propertyValue === "object" ) {
			console.debug(s + "~" + propertyName + "~ : ~{~");
			prettyPrintJSON(propertyValue, indent+1);
			console.debug(s + "~}~");
		} else {
			if (propertyName == "_content") {
				console.debug(s + "~" + propertyName + "~ : ~{~");
				element._console = eval("(" + propertyValue + ")");
				prettyPrintJSON(element._console, indent+1);
				console.debug(s + "~}~");
			} else {
				console.debug(s + "~" + propertyName + "~ : ~" + propertyValue + "~");
				i;
			}
		}
	}
}

function stringPrintJSON(element, level) {
	var sOut = "";
	var indent = (arguments.length === 1) ? 0 : level;
	
	var propertyName;
	var propertyValue;
	
	var s = "";
	for (var i = 0; i < indent; i++) { s += "&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;"; }
	
	for(propertyName in element) {
		propertyValue = element[propertyName];
		if ( typeof propertyValue === "object" ) {
			sOut += s + "~" + propertyName + "~ : ~{~<br>";
			sOut += stringPrintJSON(propertyValue, indent+1);
			sOut += s + "~}~<br>";
		} else {
			if (propertyName == "_content") {
				sOut += s + "~" + propertyName + "~ : ~{~<br>";
				element._console = eval("(" + propertyValue + ")");
				sOut += stringPrintJSON(element._console, indent+1);
				sOut += s + "~}~<br>";
			} else {
				sOut += s + "~" + propertyName + "~ : ~" + propertyValue + "~<br>";
			}
		}
	}
	return sOut;
}




