function parseSymbologyTime(t) {
		var timeLength = t.length;
		var m;
		var s;
		switch(timeLength) {
			case 1:
			case 2:
				return parseInt(t);
				break;
			case 4:
				m = parseInt(t.substring(0,2));
				s = parseInt(t.substring(2,4));
				return (m * 60) + s;
				break;
			case 3:
				m = parseInt(t.substring(0,2));
				s = parseInt(t.substring(2,4));
				return (m * 60) + s;
				break;
		}
		console.debug("ERROR parseSymbologyTime(" + t + ")");
		return 999999;
}

function calculateHighScore(gameIndex, score, currentHigh) {
	var value;
	var hScore;
	switch(gameIndex) {
		case GameIndexEnum.BuildAContact: // higher the score, higher the value
			return (score > currentHigh) ? score : currentHigh;
			break;
		
		case GameIndexEnum.MasterOfSymbology: // time format, lower is higher value
			value = parseSymbologyTime(score);			
			hScore = parseSymbologyTime(currentHigh);			
			return (value < hScore) ? score : currentHigh;
			break;
		
		case GameIndexEnum.TACO:  // score go from -70 - +68
			value = score + 70;			
			hScore = currentHigh + 70;	
			return (value > hScore) ? score : currentHigh;
			break;
		
		case GameIndexEnum.ActiveSignalRecognition:   // lower the score, higher the value
			return (score < currentHigh) ? score : currentHigh;
			break;
		
		case GameIndexEnum.PassiveNarrowbandSearch: // higher the score, higher the value
			return (score > currentHigh) ? score : currentHigh;
			break;
	}	
	console.debug("ERROR calculateHighScore(" + gameIndex + ", " + score + ", " + currentHigh + ")");
	return -9999;
}


