function getGameIndex(definitionName) {  
	if (definitionName.indexOf("Build") > -1) return GameIndexEnum.BuildAContact;
	if (definitionName.indexOf("Symbology_game") > -1) return GameIndexEnum.MasterOfSymbology;
	if (definitionName.indexOf("TAC-O_game") > -1) return GameIndexEnum.TACO;
	if (definitionName.indexOf("PEP Sandbox Tool") > -1) return GameIndexEnum.PEP;
	if (definitionName.indexOf("NbAT") > -1) return GameIndexEnum.NbAT;
	if (definitionName.indexOf("PNB_game") > -1) return GameIndexEnum.PassiveNarrowbandSearch;
	if (definitionName.indexOf("ActiveSig_game") > -1) return GameIndexEnum.ActiveSignalRecognition;
	
	return null;
}

function getMediaTypeByNumber(definitionName, objectID) { 
	if (definitionName.indexOf("ideo") > -1) return 1;
        if (definitionName.indexOf("PEP") > -1) return 1;
	if (definitionName.indexOf("name") > -1) return 0;
	if (definitionName.indexOf("tation") > -1) return 1;
	if (definitionName.indexOf("view") > -1) return 1;
	if (getGameIndex(objectID) != null) return 0;
	return -1;
}

