function calculatePercentageFilled(gameIndex, score, currentHigh) {
	var value;
	var hScore;
	if (score == -9999) return 0;
	switch(gameIndex) {
		case GameIndexEnum.BuildAContact: // higher the score, higher the value
			return (score / (currentHigh + 0.0001));
			break;
		case GameIndexEnum.MasterOfSymbology: // time format, lower is higher value
			value = Math.abs((30 * 60) - parseSymbologyTime(score));			
			hScore = Math.abs((30 * 60) - parseSymbologyTime(currentHigh)) +0.0001;			
			return (value / hScore);
			break;
		case GameIndexEnum.TACO:  // score go from -80 - +68
			value = Math.abs(score -(-80));			
			hScore = Math.abs(currentHigh - (-80)) +0.0001;
			var res = (value / hScore)
			res = (res < 0.05) ? res + 0.05 : res;	
			return res;
			break;
		case GameIndexEnum.ActiveSignalRecognition:   // lower the score, higher the value
			value = Math.abs(50 - score);			
			hScore = Math.abs(50 - currentHigh) +0.0001;			
			return (value / hScore);
			break;
		case GameIndexEnum.PassiveNarrowbandSearch: // higher the score, higher the value
			return (score / (currentHigh + 0.0001));
			break;
	}	
	console.debug("ERROR calculatePercentageFilled(" + gameIndex + ", " + score + ", " + currentHigh + ")");
	return 0;
}

function submitDurationEvents(eventMonth, durationString) {
	var reg = /P([0-9]+D)?T?([0-9]+H)?([0-9]+M)?(([0-9]+(\.[0-9]+)?)S)?/;
	var result = durationString.match(reg);
	
	var days = 0;
	var hours = 0;
	var minutes = 0;
	var seconds = 0;
	
	for (var index = 1; index < result.length; index++) {
		if (typeof(result[index]) == "undefined") { continue; }
		if (result[index].indexOf("D") > -1) { days = parseInt(result[index]);      }
		if (result[index].indexOf("H") > -1) { hours = parseInt(result[index]);     }
		if (result[index].indexOf("M") > -1) { minutes = parseInt(result[index]);   } 
		if (result[index].indexOf("S") > -1) { seconds = parseFloat(result[index]); }
	}
	
	var total15Minutes = (days * 24 * 60 + hours * 60 + minutes) / 15;
	
	total15Minutes = (total15Minutes < 1) ? 0 : total15Minutes;
	for (var index = 0; index < total15Minutes; index++) {
		addExperience(eventMonth, ExperiencePointsTypeEnum.playTime15.index);
	}
}
